/* eslint-disable react/prop-types */
import React from 'react';
import './styles.scss';

const Card = ({ img, description, title }) => {
  return (
    <div className="card-container">
      <div>
        <img scr={img} alt='img' />
      </div>
      <div>{description}</div>
      <div>{title}</div>
    </div>
  );
};

export default Card;
